import React from "react";

const Filter = () => {
  return (
    <div>
      <div>
        <span>Sort</span>
      </div>
      <div>
        <span>Filters</span>
        <div>Release Date</div>
        <div>Genres</div>
        <div>Language</div>
        <div>User Score</div>
        <div>Keywords</div>
      </div>
      <button>Search</button>
    </div>
  );
};

export default Filter;
